const Loader = () => {
  return (
    <div
      className="loader"
      style={ {
        width: '6vw',
        height: '6vw',
        margin: 'auto',
        display: 'block',
        position: 'fixed',
        top: '30%',
        left: '45%',
        zIndex: '10000',
      } }></div>
  )
}

